import React from 'react';

import {Link} from 'react-router-dom';


export const phone = (props) => {
    return (
        <div>
            <h2>Phone:</h2>
            {props.listPhone.map((phone, index) => {
                return (
                    <div>
                        <h3>
                            <Link key={phone.id}
                            to={`/phone/${phone.id}`}>
                            {phone.name}
                            </Link>
                        </h3>

                    </div>
                )
            })}

        </div>
    )
};
